import React , { Component } from 'react';
import { Reaxlass , reaxper } from 'reaxes-react';
import { reaxel_sider } from '@src/Home/sider.reaxel';
import { Dropdown , Space } from 'antd';
import RenderContent from '@src/Home/renderContent';
import './note.css';


const noteCatalog = [
	{
		label : <div>重命名</div> ,
		key : '0' ,
	} ,
	{
		label : <div>换封面</div> ,
		key : '1' ,
	} ,
	{
		label : <div>置顶笔记本</div> ,
		key : '2' ,
	} ,
	{
		label : <div>导出PDF</div> ,
		key : '4' ,
	} ,
	{
		label : <div>分享</div> ,
		key : '5' ,
	} ,
	{
		label : <div className = "delete-notebook-button">删除笔记本</div> ,
		key : '3' ,
	} ,
];

@reaxper
class NoteManagePanel extends Reaxlass {
	constructor (props) {
		super(props);
		this.inputRef = React.createRef();
	}
	
	state = {
		isSearch : false ,
		isHover : false ,//DefaultExpandIcon hover时改变显示的svg
		isModalVisible : false ,
		
	};
	
	componentDidMount () {
		this.inputRef.current?.focus();
	}
	
	handleSearchNote = () => {
	};
	
	handleMouseEnter = () => {
		this.setState({ isHover : true });
	};
	handleMouseLeave = () => {
		this.setState({ isHover : false });
	};
	
	//如果在 setState 中提供了回调函数，回调会在状态更新完成并且 DOM 已经渲染之后执行,确保能获取到最新state
	
	
	render () {
		const {
			onChangeNote ,
			onDeleteNote ,
			noteAmount ,
			OnSwitchMode ,
			showMode ,
			onToggleSidebar ,
		} = this.props;
		const { isHover } = this.state;
		const {
			toggleSiderCollapse ,
			siderCollapsed ,
			resizing ,
		} = reaxel_sider();
		return <div className = { `note-container${ resizing ? ' resizing' : '' }` }>
			{/*顶部工具栏*/ }
			<div className = "main-section-header">
				{/*笔记本名称 & dropdown*/ }
				<div className = "note-title-bar">
					<div
						onMouseEnter = { () => this.handleMouseEnter() }
						onMouseLeave = { () => this.handleMouseLeave() }
					>
						{ !siderCollapsed ? (<LeftExpandIcon
							onclick = { () => {
								toggleSiderCollapse();
								onToggleSidebar();
								this.handleMouseLeave();
							} }
						/>) : (isHover ? (<RightExpandIcon
							onclick = { () => {
								toggleSiderCollapse();
								onToggleSidebar();
							} }
						/>) : (<DefaultExpandIcon />)) }
					</div>
					<h2>我的笔记本</h2>
					<Dropdown
						placement = "bottomLeft"
						menu = { { items : noteCatalog } }
						trigger = { ['click' , 'hover'] }
					>
						<a onClick = { (e) => e.preventDefault() }>
							<DownOutLinedIcon />
						</a>
					</Dropdown>
				</div>
				
				{/*搜索 & 更多选项*/ }
				<div className = "top-tool-bar">
					<div className = "search-bar">
						<input
							ref = { this.inputRef }
							type = "text"
							className = "search-input"
							placeholder = "输入关键词..."
						/>
						<button className = "search-btn">
							<SearchNotes onSearch = { this.handleSearchNote } />
						</button>
					</div>
					<MoreNoteOptions
						onSwitchNoteMode = { OnSwitchMode }
						showMode = { showMode }
					/></div>
			</div>
			
			
			<div className = "note-amount">{ noteAmount }篇笔记</div>
			{/*Note List*/ }
			<div
				style = { {
					height : 'calc(100% - 56px)' ,
					boxSizing : 'border-box',
				} }
			>
				{ noteAmount === 0 ? (
					<div className = "empty-container">
						<EmptyIcon />
						<p>还没有笔记 , 点击右下角按钮创建吧!</p>
					</div>
				) : <RenderContent
					  changeNote = { onChangeNote }
					  deleteNote = { onDeleteNote }
					  ShowMode = { showMode }
				  /> }
			
			</div>
		
		</div>;
	}
};

