const MoreNoteOptions = ({
	onSwitchNoteMode ,
	showMode ,
}) => {
	const moreNoteOptions = [
		{
			label : <div
				style = { {
					width : '100%' ,
					height : '100%' ,
				} }
				onClick = { () => {
					onSwitchNoteMode();
				} }
			>{ showMode ? '宫格模式' : '列表模式' }</div> ,
			key : '0' ,
		} ,
		{
			label : <div>00</div> ,
			key : '1' ,
		} ,
		{
			label : <div>11</div> ,
			key : '2' ,
		} ,
	];
	return (
		<Dropdown
			placement = "bottomLeft"
			menu = { { items : moreNoteOptions } }
			trigger = { ['click' , 'hover'] }
		>
			<a onClick = { (e) => e.preventDefault() }>
				<Space>
					<MoreOptionsIcon />
				</Space>
			</a>
		</Dropdown>
	);
};

